> Entertainment Cuban artist El Sexto is freed after 10 months in prison In this Oct. 16, 2015 photo, Maria Victoria Machado stands on her front porch, wearing a T-shirt featuring a stencil art image of her son Danilo Maldonado, better known as El Sexto, in Havana, Cuba. Machado said Tuesday, Oct. 20, 2015, that her son has been freed after 10 months behind bars for attempting to release two pigs painted with the names of Raul and Fidel Castro, the country’s current president and former leader. (AP Photo/Desmond Boylan) 
